import React, { Component } from 'react';

export default class SectionUsluge extends Component {
	render() {
		return (
			<React.Fragment>
				<dir className="bg-purple">
					<Container>
						<Row>
							<Col>1 of 3</Col>
							<Col xs={6}>2 of 3 (wider)</Col>
							<Col>3 of 3</Col>
						</Row>
						<Row>
							<Col>1 of 3</Col>
							<Col xs={5}>2 of 3 (wider)</Col>
							<Col>3 of 3</Col>
						</Row>
					</Container>
				</dir>
			</React.Fragment>
		);
	}
}
